import React from "react";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

function Body(props) {
  return (
    <div>
      <Container fluid="true">
        <Row className="justify-content-center py-5">
          <Col className="text">
            {props.title && (
              <div className="display-2 font-weight-bold">{props.title}</div>
            )}
            {props.subTitle && (
              <div className="display-6 font-weigth-light">
                {props.subTitle}
              </div>
            )}
            {props.text && (
              <div className="lead font-weight-light">{props.text}</div>
            )}
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Body;
